import React from 'react';
import { StyleSheet, Image, View } from 'react-native';
import Button from '../components/Button';
import Background from '../components/Background';
import { Text } from 'react-native-paper';

export default function QuizEndingScreen({ navigation }) {
    return (
        <Background>

                <View style={styles.iconContainer}>
                    <Text style={styles.text}>Congrats on successfully completing this trivia!</Text>
                    <Image source={require('../assets/iconmoonlightning.png')}  />
                    <Text style={styles.score}>+250</Text>

                </View>
                <Button
                    color="green"
                    mode="contained"
                    onPress={() => navigation.navigate('Dashboard')}
                >
                    Finish
                </Button>

        </Background>
    );
}

const styles = StyleSheet.create({

    iconContainer: {
        alignItems: 'center',

    },
    image: {
        width: 93.32, // Adjust this size as needed
        height: 70.32, // Adjust this size as needed
        borderRadius: 46.66, // Half of the width and height to make it a circle
        backgroundColor: 'rgba(217, 217, 217, 1)', // Adjust the color as needed
    },
    text: {
        fontSize: 24,
        fontWeight: 'bold',
        marginBottom: 80, // Adjust spacing between text and icon
        alignItems: 'center',
    },
    score: {
        fontSize: 26,
        fontWeight: 'bold',
        marginTop: 22, // Adjust spacing between text and icon
    },
});
